import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="bg-blue-600 p-4 text-white flex justify-around">
      <Link to="/" className="font-bold hover:underline">Home</Link>
      <Link to="/about" className="font-bold hover:underline">About</Link>
      <Link to="/products" className="font-bold hover:underline">Products</Link>
    </nav>
  );
};

export default Navbar;
